import React, { useContext } from "react";
import { SongContext } from "../contexts/SongContext";

const SongDetails = ({ song }) => {
  return (
    <li key={song.id}>
      <div className="title"> {song.title}</div>
      <div className="author"> {song.singer}</div>
    </li>
  );
};

export default SongDetails;
